Licensidentifierare, som är en globalt unik identifierare för en licens eller ett kontrakt under vilket artiklar genereras, lämnas in för bearbetning och/eller betalas för, som konstrueras genom att sammanfoga:
 - en ISO/IEC 15459 utfärdande byråkod;
 - ett licens- eller kontraktsnummer som överensstämmer med specifikationerna för den berörda utfärdande byrån;
 och det:
 - består enbart av versala alfabetiska och/eller numeriska tecken;
 - är unikt (det vill säga skiljer sig från alla andra ISO/IEC 15459 kompatibla identifierare) inom den utfärdande byråns domän;
 - kan inte härledas från någon annan ISO/IEC 15459 kompatibel identifierare, utfärdad under samma utfärdande byrå, genom enkel tillägg av tecken till, eller deras borttagning från, dess slut.

FAO fiskeområdeskod som definieras av Fiskeri- och akvakulturförvaltningen vid FAO (http://www.fao.org. Sök efter Fishing Area Code underwebbplats).
Alla tecken från GS1 General Specification-definierade delmängden av ISO/IEC 646 är tillåtna.
Exempel:
18L37.1.3 Västra Medelhavet, Sardinien;
18L47.B.1 Atlanten, sydost, SEAFO-divisionen, Namibias EEZ;
18L67 Stilla havet, nordost.

'26L' Platskod, som är en kod som identifierar en plats eller ett geografiskt område, eller en associerad grupp av sådana platser eller områden, som är relevant för en relaterad transaktion och som överensstämmer med en av strukturerna som definieras i (a) till (f) nedan:
a) två versala alfabetiska tecken som motsvarar ISO 3166-1 två alfakod för det land där, eller bestående av vilket, platsen/platserna eller området/områdena är belägna;
b) tre versala alfabetiska tecken som motsvarar IATA-koden för flygplatsen eller staden i, nära, eller bestående av vilken platsen/platserna eller området/områdena är belägna;
c) fyra eller fler tecken där de första tre motsvarar en ISO 3166-1 landskod följt av ett streck (-), med resten som en postkod i det berörda landet;
d) fyra eller fler tecken där de första tre motsvarar en ISO 3166-1 landskod följt av en punkt (.), med resten som en ISO 3166-2 landsunderindelningskod i det berörda landet;
e) fem versala alfabetiska tecken som motsvarar UN/LOCODE för området i, nära, eller bestående av vilket, platsen/platserna eller området/områdena är belägna;
f) sammanfogningen, som är inte mindre än sju eller mer än 35 tecken lång, av:
- en ISO/IEC 15459 utfärdande byråkod;
- en platskod, bestående av tecken dragna från uppsättningen {A-Z; 0-9} som överensstämmer med specifikationerna för den berörda utfärdande byrån.

