Utrustningsidentifierare, som är en globalt unik identifierare för en enhet, en utrustningsartikel eller instans av en datorapplikation som används i produktionen, transporten, bearbetningen eller annan hantering av artiklar, som konstrueras genom att sammanfoga:
 - en ISO/IEC 15459 utfärdande myndighetskod;
 - ett utrustningsnummer som överensstämmer med specifikationerna för den berörda utfärdande myndigheten; och som:
 - består endast av stora bokstäver och/eller numeriska tecken;
 - är unikt (det vill säga skiljer sig från någon annan ISO/IEC 15459 kompatibel identifierare) inom utfärdande myndighetens domän;
 - inte kan härledas från någon annan ISO/IEC 15459 kompatibel identifierare, utfärdad under samma utfärdande myndighet, genom enkel tillägg av tecken till, eller deras borttagning från, dess slut.
Läsar-ID.
Utrustningsidentifierare, som är en globalt unik identifierare för en enhet, en utrustningsartikel eller instans av en datorapplikation som används i produktionen, transporten, bearbetningen eller annan hantering av artiklar.

UPU-platskod, som är en kod som identifierar en plats eller geografiskt område, eller en associerad grupp av sådana platser eller områden, som har relevans för en relaterad transaktion och som överensstämmer med en av strukturerna definierade i a) till g) nedan:
a) två versala alfabetiska tecken som motsvarar ISO 3166-1 två alfa-landskoden för det land där, eller bestående av vilket, plats(en) eller område(n) är belägna;
b) tre versala alfabetiska tecken som motsvarar IATA-koden för flygplatsen eller staden i, nära, eller bestående av vilken plats(en) eller område(n) är belägna;
c) fyra eller fler tecken varav de första tre motsvarar en ISO 3166-1 landskod följt av ett bindestreck (-), med resten som är ett postnummer i det berörda landet;
d) fyra eller fler tecken varav de första tre motsvarar en ISO 3166-1 landskod följt av en punkt (.), med resten som är en ISO 3166-2 landsunderindelningskod i det berörda landet;
e) fem versala alfabetiska tecken som motsvarar UN/LOCODE för området i, nära, eller bestående av vilket, plats(en) eller område(n) är belägna;
f) sex versala alfanumeriska tecken som motsvarar en UPU IMPC-kod tilldelad i enlighet med UPU-standarden S34;
g) sammanfogningen, som är inte mindre än sju eller mer än 25 tecken lång, av:
 - en utfärdarkod tilldelad i enlighet med UPU-standarderna S31;
 - en platskod, bestående av tecken hämtade från uppsättningen {A-Z; 0-9} som överensstämmer med specifikationerna för den utfärdande myndigheten.

Registreringsskylt med Service Data och Platskod är en sammansatt datakonstruktion, i enlighet med specifikationen i UPU-standarden S25, som inkluderar specifikation av:
 - en ISO/IEC 15459-kompatibel föremålsidentifierare;
 - en dataidentifierare 5U-kompatibel specifikation av den tjänst som ska tillhandahållas i förhållande till föremålet;
 - en dataidentifierare 17U-kompatibel UPU-platskod eller en dataidentifierare 18U-kompatibel kvalificerad UPU-platskod.
 Obs - För ytterligare detaljer, vänligen hänvisa till UPU-standarden S25. Skillnaden mellan en enkel UPU-platskod (DI 17U) och en kvalificerad UPU-platskod (DI 18U) kan bestämmas från det första tecknet. Om detta är numeriskt, gäller 18U; om det är alfabetiskt, gäller 17U.

Händelse, Datum, Och Tid.
ISO-format YYYYMMDDHHMM (24-timmarsklocka - UTC) omedelbart följt av en UN/EDIFACT Kodkvalificerare 2005 som ger en kod som specificerar typ av datum), t.ex.,
11 [Datum då varor förväntas bli avsända/fraktade när meddelande utfärdas.];
