133 [Datum/tid då transportören uppskattar att ett transportmedel bör avgå från avgångsplatsen];
137 [Datum/tid då leverantören skickar delar baserat på kundens begäran. (Datum då DESADV-meddelande utfärdas. Rekommendationen är att DESADV utfärdas inom 30 minuter efter att varor hämtas upp hos ShipFrom-part];
146 [Beräknat Inträdesdatum (Tull) datum då det officiella datumet för en Tullinträde förväntas.];
151 [Importdatum (Anlänt till hamn med avsikt att lossa];
186 Avgår från en Anläggning ('Gate-out)];
204 [Datum då Tullen släpper varor till transportören eller importören];
253 [Avgår från en Hamn ('Fartygsavgång')];
252 [Anländer till en Hamn ('Fartygsankomst')];
283 [Anländer till en Anläggning ('Gate-in)];
342 [Transportmedel Lastat];
