696 [Inlämningsdatum].

Datum, representerat i modifierad UTC-kompatibel form:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] där kvadratiska klamrar indikerar valfrihet och yyyy är året, mmdd månaden och dagen, hhmmss tiden på dagen i timmar minuter och sekunder, fff fraktioner av sekunder och poooo avvikelsen från UTC uttryckt i timmar och minuter, avvikelsen är positiv om p är en punkt (.), negativ om P är ett minustecken (-).
EXEMPEL:
2005 - (UTC) kalenderår 2005;
200505 - (UTC) kalendermånad maj 2005;
20050518 - (UTC) 18 maj 2005;
200505181247 - 12:47 UTC den 18 maj 2005;
200505181247.0100 - 12:47 lokal tid, som är 11:47 UTC, den 18 maj 2005;
20050518124723099 - 99 millisekunder efter UTC 12:47:23 den 18 maj 2005.

Kvalificerat Datum, bestående av sammanfogningen av:
- en ISO/IEC 15459 utfärdande myndighetskod;
- en datumkvalificerare som överensstämmer med specifikationerna för den utfärdande myndigheten;
- ett datum vars format och tolkning överensstämmer med specifikationerna för den utfärdande myndigheten för den datumkvalificeraren.

Deklaration av Förpackningsmaterialkategori*, Kod* och Vikt för ett visst förpackningsmaterial som används i en viss förpackning enligt EU:s förpacknings- och förpackningsavfallsdirektiv. (Materialkategori och kod definierad i Bilaga M).
12ECCMMMMMMNNNNNUU där: - '12E' (an3) är Dataidentifieraren;
 - 'CC' (n2) är Materialkategorin enligt Bilaga M;
 - 'MMMMMM' (an1...6) är Materialkoden enligt Bilaga M;
 - 'NNNNN' (n5) Materialvikt, inklusive decimalpunkt (t.ex., 12.12);
 - 'UU' (an2) är Viktenhet (t.ex., KG, GR, LB eller OZ enligt ANSI X12.3 som i Bilaga D).

