Mottagarnummer.
Det unika identifieringsnumret kan vara IRS, EIN, SSN, eller CBP-tilldelat nummer, som krävs på Säkerhetsinlämningen. Endast följande format ska användas: IRS EIN: NN-NNNNNNN;
IRS EIN m/ suffix:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP tilldelat nbr: YYDDPP-NNNNN.
